export default function Aktivity() {
  return (
          <div class="card">
            <div class="margin-top margin-left20 margin-right20">Aktivitas</div>
            <div class="card-body">
              <span>Yusron baru saja menambahkan lokasi baru Kantor Cabang Jagakarsa</span>
              <p class="text-muted">Hari ini, 06.00</p>
              <span>Yusron baru saja menghapus sublokasi KCP Tebet 4 dari induk Kantor Cabang Tebet</span>
              <p class="text-muted">Kemarin, 17.32</p>
              <span>Yusron melakukan perubahan profil pada induk Kantor Cabang Bekasi</span>
              <p class="text-muted">Kemarin, 17.32</p>
            </div>
          </div>
  );
}
